import React from "react"

function Header() {
    return (
        <header>
            <img 
                // src="https://upload.wikimedia.org/wikipedia/en/9/9a/Trollface_non-free.png" 
                src="http://assets.stickpng.com/images/580b585b2edbce24c47b2a2f.png"
                alt="Problem?"
                height="100px"
                width="100px"
            />
            <p>Meme Generator</p>
        </header>
    )
}

export default Header
